import React from "react";
import { Container } from "react-bootstrap";

function MyList({ movieDetails }) {
  // Check if movieDetails is undefined
  if (!movieDetails) {
    return null; // Return null if movieDetails is undefined
  }

  // Destructure properties from movieDetails
  const { id, movieTitle, movieImageURL } = movieDetails;

  return (
    <Container>
      <h2>My List</h2>
      <div>
        <p>ID: {id}</p>
        <p>Title: {movieTitle}</p>
        <img src={movieImageURL} alt={movieTitle} />
      </div>
    </Container>
  );
}

export default MyList;
